def floor_sqrt(x: int) -> int:
    st = 1
    en = x
    while st <= en:
        mid = (st + en) // 2
        if mid * mid == x:
            return int(mid)
        elif mid * mid < x:
            st = int(mid + 1)
        else:
            en = int(mid - 1)
    return int(en)

